import React, { Component } from "react";
import styled from "styled-components";

class Toolbar extends Component {
  render() {
    return (
      <ToolBarWrapper>
        <header className="navbar navbar-expand-sm navbar-dark px-sm-4">
          <nav className="toolbar_nav">
            <div></div>
            <div className="toolbar-logo">
              {" "}
              <a href="/">Home</a>
            </div>
            <div className="toolbar-nav">
              <ul>
                <li>
                  <a href="/Products">Products</a>
                </li>
                <li>
                  <a href="/ShoppingCart">My Cart</a>
                </li>
              </ul>
            </div>
          </nav>
        </header>
      </ToolBarWrapper>
    );
  }
}
export default Toolbar;

const ToolBarWrapper = styled.nav`
  .navbar {
    background: var(--darkRed);
    height: 100px;
    width:100vw;
    top:0;
    left:0;
  }

  .toolbar-logo a {
    color: white;
    text-deceration: none;
    font-size: 1.5rem;
  }

  .toolbar-nav {
    display: flex;
    align-items: center;
    height: 100%;
  }
`;
